import classes from './ServiceDropdown.css';
import React from "react";





const ServiceDropdown = (props) => {

    let  DropdownList = props.menuData.map(e=>
        <li key={e.id} className={classes.li_dropdoun}>
            <a className={classes.active} href={e.url}>{e.label}</a>
        </li>
    );

    return(
        <div>
            {DropdownList}
        </div>

    );

};

export default ServiceDropdown;
